import React from "react";
import ReactDOM from 'react-dom'
import {responsive} from './responsive.js'
import {Main} from './index.js'
export class Heading extends React.Component{
    constructor(){
        super()
        let arr=responsive.heading();
        this.state={main:arr[0],hr:arr[1]}
        this.resize=this.resize.bind(this);
        window.addEventListener('resize',this.resize);
        window.addEventListener('scroll',this.resize);
    }
    resize(){
        let arr=responsive.heading();
        this.setState({main:arr[0],hr:arr[1]});
    }
    render(){
        return(
            <h1 style={this.state.main} onClick={()=>{ReactDOM.render(<Main/>,document.getElementById('root'))}}>
                Binary.c
                <hr style={{width:'100%',position:'relative',float:'left'}}></hr>
            </h1>
        )
    }
}
